package dp.interpreter;import java.util.*;// <command list> ::= <command>* ENDpublic class CommandList implements Node {	private List<Node> commands = new ArrayList<Node>();		@Override	public void parse(Context context){		while(true){			if(context.currentToken() == null){				System.err.println("Missing 'END'");				break;			} else if(context.currentToken().equals("END")){				context.skipToken("END");				break;			} else {				Node command = new Command();				command.parse(context);				this.commands.add(command);			}		}	}		@Override	public void execute(){		for(Node command: this.commands){			command.execute();		}	}}